.fab-default-container {
    width: 90%;
    margin: 8% auto;
    text-align: center;
    max-width: 600px;
}
.custom-index {
    z-index: 500 !important;
}

.fab-default-container .col-xs-12 {
    position: relative;
    margin: 15px 0;
    min-height: 100px;
}

.fab-default-container .col-md-6 {
    padding: 0;
}

index.js:
import { createRoot } from 'react-dom/client';
import './index.css';
import * as React from 'react';
import { FabComponent } from "@syncfusion/ej2-react-buttons";
import { SampleBase } from './sample-base';

export class Default extends SampleBase {
    render() {
        return (<div className='control-pane'>
            <div className="control-section">
                <div className="fab-default-container">
                    <div className="row">
                        <div className="col-xs-6 col-sm-6 col-lg-6 col-md-6">
                            <div id="target1" className="col-xs-12 col-sm-12 col-lg-6 col-md-6 custom-index">
                            </div>
                            <div id="target2" className="col-xs-12 col-sm-12 col-lg-6 col-md-6 custom-index">
                            </div>
                        </div>
                        <div className="col-xs-6 col-sm-6 col-lg-6 col-md-6">
                            <div id="target3" className="col-xs-12 col-sm-12 col-lg-6 col-md-6 custom-index">
                            </div>
                            <div id="target4" className="col-xs-12 col-sm-12 col-lg-6 col-md-6 custom-index">
                            </div>
                        </div>
                    </div>

                    {/* Icon and isPrimary is false */}
                    <FabComponent id="fab1" iconCss='e-icons e-people' isPrimary={false} position='MiddleCenter' title="Contact" target='#target1'></FabComponent>

                    {/* Icon with Label */}
                    <FabComponent id="fab2" iconCss='e-icons e-people' content="Contact" position='MiddleCenter' target='#target2'></FabComponent>

                    {/* Icon with Disabled true */}
                    <FabComponent id="fab3" content='Disabled' disabled={true} iconCss='e-icons e-people' position='MiddleCenter' target='#target3'></FabComponent>

                    {/* Label only */}
                    <FabComponent id="fab4" content='Text Content' cssClass='e-warning' position='MiddleCenter' target='#target4'></FabComponent>
                </div>
            </div>
        </div>);
    }
}

const root = createRoot(document.getElementById('sample'));
root.render(<Default />);

